import React from "react";
import "./App.css";
import Footer from "./Components/Footer";
import Home from './Components/Home';
import OurMotive from "./Components/OurMotive";
import Ourservice from "./Components/Ourservice";

function App() {
  return (
    <>
    <Home/>
    <Ourservice />
    <OurMotive/>
    <Footer/>
    </>
  );
}

export default App;
